Axanar is the independent Star Trek film which proves that a feature-quality Star Trek film can be made on a small budget.

Our 21-minute short film, Prelude to Axanar, premiered Saturday, July 26th, 2014, at San Diego Comic Con and features Richard Hatch, Tony Todd, Kate Vernon, JG Hertzler and Gary Graham, who reprises his role of Soval from &quot;Enterprise&quot;.
